syntax = "proto3";
option go_package = "github.com/tinkler/mqttadmin/mrz/v1;mrz_v1";
option java_multiple_files = true;
option java_package = "ink.sfs.tinkler.mqttadmin.mrz.v1";
option java_outer_classname = "MrzProto";
package mrz.v1;

import "google/protobuf/any.proto";

message Model {
    google.protobuf.Any data = 1;
    google.protobuf.Any Args = 2;
}

message Res {
    google.protobuf.Any data = 1;
    google.protobuf.Any resp = 2;
}